private static boolean containsNamedAce(Map<String, String> aclEntries, boolean checkDefault) {
  for (String entryKey : aclEntries.keySet()) {
    if (isNamedAce(entryKey) && (checkDefault == isDefaultAce(entryKey))) {
      return true;
    }
  }
  return false;
}
